import {ConnectionLine, Coordinates} from "./lineCalculation/ConnectionLine";

const CONNECTION_PROBABILITY = 0.1;
function getRandomDots(n: number): Coordinates[] {
    const screenWidth = window.innerWidth
    const screenHeight = window.innerHeight - 100
    const dots: Coordinates[] = []
    for (let i = 0; i < n; i++) {
        dots.push({
            x: Math.random() * screenWidth,
            y: Math.random() * screenHeight,
        })
    }
    return dots
}

function getRandomMatrix(n: number): number[][] {
    const matrix = []
    for (let i = 0; i < n; i++) {
        const matrixLine = []
        for (let i = 0; i < n; i++) {
            matrixLine.push(0)
        }
        matrix.push(matrixLine)
    }
    for (let i = 0; i < n; i++) {
        for (let j = 0; j < i; j++) {
            if (i === j) {
                matrix[i][j] = 0
            }
            else {
                let a = Math.random() > CONNECTION_PROBABILITY ? 0 : 1
                matrix[i][j] = a
                matrix[j][i] = a
            }
        }
    }
    return matrix
}
